La mission 

Pour valoriser le projet Monténégro LAB, un projet transmédia avec des habitants dans les communes de Saint-Gilles et de Forest, nous souhaitons développer un site web permettant de référencer tous les contenus (sons, vidéos, parcours sonore). La mission permet aussi de co-développer techniquement un parcours sonores dans l’espace public. Monténégro LAB regroupe des professionnels des médias, de l’audiovisuel et de l’éducation permanente.


Co-conception et développement d’une plateforme regroupant des contenus multimédias;
Développement de toutes les fonctionnalités techniques du site;
Mise en place technique d’un parcours sonore (puce NFC et/ou Beacon);
Optimisation technique des outils web;
Assurer une veille technologique;
Participation à la vie de l’asbl.

Profil

Bonne connaissance des standards Web (XHTML/CSS/DOM);
Attrait pour l’expérience utilisateur et les méthodes de design thinking; 
Volonté de s’adapter aux langages et aux besoins de l’équipe;
Attrait pour les médias et les projets transmédias;
Organisé·e et appétence pour le travail en équipe;
Curieu·x·se, capacité d’adaptation et autonome;
Bon relationnel, prise d’initiatives .
